    "import math\n",
    "import numpy as np\n",
    "import matplotlib.pyplot as plt\n",
    "def f(x):\n",
    " g = 3**(x) - math.sin(x) + math.cos(5*x)\n",
    " return g;\n",
    "def g(x):\n",
    " f = np.log(3)*(3**x) - math.cos(x) - 5*math.sin(5*x)\n",
    " return f;\n",
    "def Newton(tol,initial):\n",
    " a = []\n",
    " a.append(initial)\n",
    " i = 0\n",
    " while abs(f(a[i])) > tol:\n",
    "  a.append(a[i] - f(a[i])/g(a[i]))\n",
    "  i = i+1\n",
    "  plt.plot(range(0, i+1),a)"
